import React from 'react';
import Card from './Card'; // Ensure this is the correct import path
import './Swimlane.css'; // Check your styles to make sure they aren't hiding cards

export default function Swimlane({ name, clients, dragulaRef }) {
  return (
    <div className="Swimlane-column" data-status={name}>
      <div className="Swimlane-title">{name}</div>
      <div className="Swimlane-dragColumn" ref={dragulaRef}>
        {clients.map(client => (
          <Card
            key={client.id}
            id={client.id}
            name={client.name}
            description={client.description}
            status={client.status} // Ensure status is passed
          />
        ))}
      </div>
    </div>
  );
}

